3e7d6986ee8987409a906e3d5adb0991b4a5c685:
query ProductPageQuery($id: String!) {
  site {
    siteMetadata {
      title
      description
      titleTemplate
      siteUrl
    }
  }
  product: storeProduct(id: {eq: $id}) {
    id: productID
    slug
    seo {
      title
      description
    }
    brand {
      name
    }
    name
    description
    sku
    gtin
    breadcrumbList {
      itemListElement {
        item
        name
        position
      }
    }
    image {
      url
      alternateName
    }
  }
}

